/*--------------------------------------------------------------
 
  BLAS/LAPACK-like subroutines used by the integration algorithms
  It is recommended to replace them by calls to the optimized
       BLAS/LAPACK library for your machine
 
   (C) Adrian Sandu, Aug. 2004
 
--------------------------------------------------------------*/

#define ZERO  (double)0.0
#define ONE   (double)1.0
#define HALF  (double)0.5
#define TWO   (double)2.0
#define MOD(A,B) (int)((A)%(B))

/*~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
void WCOPY(int N, double X[], int incX, double Y[], int incY)
/*~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
    copies a vector, x, to a vector, y:  y <- x
    only for incX=incY=1
    after BLAS
    replace this by the function from the optimized BLAS implementation:
        CALL  SCOPY(N,X,1,Y,1)   or   CALL  DCOPY(N,X,1,Y,1)
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
{
    
    int i, M;
    if (N <= 0) return;

    M = MOD(N,8);
    if( M != 0 ) {
        for ( i = 0; i < M; i++ )
            Y[i] = X[i];
        if( N < 8 ) return;
    } /* end if */	
    for ( i = M; i<N; i+=8 ) {
        Y[i] = X[i];
        Y[i + 1] = X[i + 1];
        Y[i + 2] = X[i + 2];
        Y[i + 3] = X[i + 3];
        Y[i + 4] = X[i + 4];
        Y[i + 5] = X[i + 5];
        Y[i + 6] = X[i + 6];
        Y[i + 7] = X[i + 7];
    } /* end for */

} /* end function WCOPY */


/*~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
void WAXPY(int N, double Alpha, 
         double X[], int incX, 
	 double Y[], int incY )
/*~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
    constant times a vector plus a vector: y <- y + Alpha*x
    only for incX=incY=1
    after BLAS
    replace this by the function from the optimized BLAS implementation:
        CALL SAXPY(N,Alpha,X,1,Y,1) or  CALL DAXPY(N,Alpha,X,1,Y,1)
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
{
    
    int i, M;

    if (Alpha == ZERO) return;
    if (N  <=  0) return;

    M = MOD(N,4);
    if( M != 0 ) {
        for ( i = 0; i < M; i++ )
            Y[i] = Y[i] + Alpha*X[i];
        if ( N < 4 ) return;
    } /* end if */
      
    for ( i = M; i < N; i += 4 ) {
        Y[i] = Y[i] + Alpha*X[i];
        Y[i + 1] = Y[i + 1] + Alpha*X[i + 1];
        Y[i + 2] = Y[i + 2] + Alpha*X[i + 2];
        Y[i + 3] = Y[i + 3] + Alpha*X[i + 3];
    } /* end for */

} /* end function  WAXPY */



/*~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
void WSCAL(int N, double Alpha, double X[], int incX)
/*~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
    constant times a vector: x(1:N) <- Alpha*x(1:N) 
    only for incX=incY=1
    after BLAS
    replace this by the function from the optimized BLAS implementation:
        CALL SSCAL(N,Alpha,X,1) or  CALL DSCAL(N,Alpha,X,1)
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
{
    
    int i, M;
      
    if (Alpha == ONE) return;
    if (N  <=  0) return;

    M = MOD(N,5);
    if( M  !=  0 ) {
        if (Alpha == (-ONE))
            for ( i = 0; i < M; i++ )  X[i] = -X[i];
        else {
	        if (Alpha == ZERO)
                for ( i = 0; i < M; i++ ) X[i] = ZERO;
            else
                for ( i = 0; i < M; i++ ) X[i] = Alpha*X[i];
        } /* end else */
        if( N < 5 ) return;
    } /* end if */
      
    if (Alpha == (-ONE))
        for ( i = M; i<N; i+=5 ) {
            X[i]     = -X[i];
            X[i + 1] = -X[i + 1];
            X[i + 2] = -X[i + 2];
            X[i + 3] = -X[i + 3];
            X[i + 4] = -X[i + 4];
        } /* end for */
    else {
        if (Alpha == ZERO)
            for ( i = M; i < N; i += 5 ) {
                X[i]     = ZERO;
                X[i + 1] = ZERO;
                X[i + 2] = ZERO;
                X[i + 3] = ZERO;
                X[i + 4] = ZERO;
            } /* end for */
        else
            for ( i = M; i < N; i += 5 ) {
                X[i]     = Alpha*X[i];
                X[i + 1] = Alpha*X[i + 1];
                X[i + 2] = Alpha*X[i + 2];
                X[i + 3] = Alpha*X[i + 3];
                X[i + 4] = Alpha*X[i + 4];
            } /* end for */
    }  /* else  */
      
} /* end function WSCAL */
   
     
/*~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
double WLAMCH_ADD( double  A, double  B )
{

    return (A + B);

} /* end function  WLAMCH_ADD */

/*~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
double WLAMCH( char C )
/*~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
    returns epsilon machine
    after LAPACK
    replace this by the function from the optimized LAPACK implementation:
         CALL SLAMCH('E') or CALL DLAMCH('E')
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
{
    
    int i;
    double Suma;
    static double Eps;
    static char First = 1;
     
    #pragma omp threadprivate( Eps, First )

    if (First) {
        First = 0;
        Eps = pow(HALF,16);
        for ( i = 17; i <= 80; i++ ) {
            Eps = Eps*HALF;
	        Suma = WLAMCH_ADD(ONE,Eps);
	        if (Suma <= ONE) break;
        } /* end for */
        if ( i == 80 ) {
	        printf("\nERROR IN WLAMCH. Very small EPS = %g\n",Eps);
            return (double)2.2e-16;
	    }
        Eps *= TWO; i--;        
    } /* end if First */

      return Eps;

} /* end function WLAMCH */


/*~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
 	copies zeros into the vector y:  y <- 0 after BLAS
  ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
void Set2Zero(int N, double Y[])
{
        
    int i,M;
	
    if (N <= 0) return;

    M = MOD(N,8);
    if  (M != 0) {
	    for (i = 0; i < M; i++) {
            Y[i] = ZERO;
	    }
	    if (N < 8) 
	        return;
    } /* end if */
   
    for (i = M; i < N; i += 8) {
       	Y[i] = ZERO;
	    Y[i + 1] = ZERO;
        Y[i + 2] = ZERO;
    	Y[i + 3] = ZERO;
	    Y[i + 4] = ZERO;
    	Y[i + 5] = ZERO;
	    Y[i + 6] = ZERO;
    	Y[i + 7] = ZERO;
    } /* end for */

} /* end function Set2Zero */

/*~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
	adds two vectors: z <- x + y     BLAS - like
  ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
void WADD(int N, double X[], double Y[], double Z[])
{

    int i, M;

	if ( N <= 0 ) return;
	
	M = MOD(N,5);
	if ( M != 0 ) {
	    for(i = 0; i < M; i++) {
    		Z[i] = X[i] + Y[i];
        }
	    if ( N < 5 ) return;
	} /* end if */

	for (i = M; i < N; i += 5) {
        Z[i] = X[i] + Y[i];
	    Z[i + 1] = X[i + 1] + Y[i + 1];
	    Z[i + 2] = X[i + 2] + Y[i + 2];
	    Z[i + 3] = X[i + 3] + Y[i + 3];
	    Z[i + 4] = X[i + 4] + Y[i + 4];
	} /* end for */

} /* end function WADD */

